import React from "react"
export default function TopListReducer(toplist={   //状态管理函数，来管理榜单数据
    Updata:[],
    Newdata:[],
    Orgdata:[]
},action){
    if(action.type==="topListUp_data"){
        return {Updata:action.data}
    }else if(action.type==="topListNew_data"){
        return {Newdata:action.data}
    }else if(action.type==="topListOrg_data"){
        return {Orgdata:action.data}
    }else{
        return toplist;
    }
}

function UPdataReducer(toplist={
    Updata:[]
},action){
    if(action.type==="topListUp_data"){
        return {Updata:action.data}
    }else{
        return toplist;
    }
}
